            "name": "East CB Daily Phone Bank",
            "van_name": "R01C_Phonebank_DailyPB",
            "tagline": "Dream Big, Fight Hard",
            "description": "Make calls with Team Warren any day of the week! We'd love to have you at our weekly phone banks. But if you can't make it to that you can still make calls online! Email sschlesinger@elizabethwarren.com to learn how.\n\nIf you aren't able to come  physically to our phone bank in Council Bluffs, Iowa, please TEXT Sonia at 202-400-1524 when you want to phone bank so that she can get you set up online.\n\nOur team knows that to create real change – to rebuild the middle class and save our democracy – we need to dream big and fight hard. That's why we’re in this fight: to have real conversations about how to level the playing field for working families, and who is best to lead that fight.\n\nIf you have any accessibility needs, please let Sonia know by emailing sschlesinger@elizabethwarren.com or calling/texting 202-400-1524 so that we can make sure the event will be accessible and comfortable for you.\n\nWe’ll see you there (virtually)! Thanks for being a part of this fight.",
