            "name": "Dickinson County Area Daily phone calls",
            "van_name": "R02C_All_DailyPhoneBankShift",
            "tagline": "Dream Big, Fight Hard",
            "description": "Join us for a phone bank in Dickinson County to talk with people in your area about the big, structural change that Elizabeth is fighting for in Iowa. Bring a cell phone if you have one. \n\nDickinson county and the surrounding area are in Congressional District 4, the home of Steve King. Let's show Congressman King what we can do by fighting together for Elizabeth Warren!\n\nOur team knows that to create real change – to rebuild the middle class and save our democracy – we need to dream big and fight hard. That's why we’re in this fight: to have real conversations about how to level the playing field for working families, and who is best to lead that fight.\n\nIf you have any accessibility needs, please let Bryce know by emailing bpeppers@elizabethwarren.com or calling/texting 912-222-8127 so that we can make sure the event will be accessible and comfortable for you.\n\nWe’ll see you there! Thanks for being a part of this fight.",
