            "id": 133279,
            "name": "Webster County Daily Canvass",
            "van_name": "R02K_Canvass_Webster County Daily Canvass",
            "tagline": "Dream big, fight hard.",
            "description": "Join us for a canvass in Webster County to talk with your neighbors about the big, structural change that Elizabeth is fighting for in Iowa.\n\nOur team knows that to create real change – to rebuild the middle class and save our democracy – we need to dream big and fight hard. That's why we’re in this fight: to have real conversations about how to level the playing field for working families, and who is best to lead that fight.\n\nIf you have any accessibility needs, please let Greg Self know by emailing gself@elizabethwarren.com or calling/texting 310-779-6808 so that we can make sure the event will be accessible and comfortable for you.\n\nWe’ll see you there! Thanks for being a part of this fight.",
