            "name": "Webster County Canvass",
            "van_name": "R02B_Canvass_Webster County Canvass",
            "tagline": "Dream Big, Fight Hard",
            "description": "Come knock on your neighbors doors in Webster County this weekend to hear from the caucus goers and talk about Elizabeth Warren and her policies!\n\nOur team knows that to create real change – to rebuild the middle class and save our democracy – we need to dream big and fight hard. That's why we’re in this fight: to have real conversations about how to level the playing field for working families, and who is best to lead that fight.\n\nIf you have any accessibility needs, please let Jamie know by emailing jstevenson@elizabethwarren.com or calling/texting 712-382-4452 so that we can make sure the event will be accessible and comfortable for you.\n\nWe’ll see you there! Thanks for being a part of this fight.",
            "description_html": "<p>Come knock on your neighbors doors in Webster County this weekend to hear from the caucus goers and talk about Elizabeth Warren and her policies!</p>\n<p>Our team knows that to create real change – to rebuild the middle class and save our democracy – we need to dream big and fight hard. That's why we’re in this fight: to have real conversations about how to level the playing field for working families, and who is best to lead that fight.</p>\n<p>If you have any accessibility needs, please let Jamie know by emailing jstevenson@elizabethwarren.com or calling/texting 712-382-4452 so that we can make sure the event will be accessible and comfortable for you.</p>\n<p>We’ll see you there! Thanks for being a part of this fight.</p>",
